// HasAddonRatecard applies the HasEdge predicate on the "addon_ratecard" edge.
func HasAddonRatecard() predicate.RateCard {
	return predicate.RateCard(func(s *sql.Selector) {
		step := sqlgraph.NewStep(
			sqlgraph.From(Table, FieldID),
			sqlgraph.Edge(sqlgraph.O2O, false, AddonRatecardTable, AddonRatecardColumn),
		)
		sqlgraph.HasNeighbors(s, step)
	})
}

// HasAddonRatecardWith applies the HasEdge predicate on the "addon_ratecard" edge with a given conditions (other predicates).
func HasAddonRatecardWith(preds ...predicate.AddonRateCard) predicate.RateCard {
	return predicate.RateCard(func(s *sql.Selector) {
		step := newAddonRatecardStep()
		sqlgraph.HasNeighborsWith(s, step, func(s *sql.Selector) {
			for _, p := range preds {
				p(s)
			}
		})
	})
}

